<script>
    function getFocus(){
        $(""#Name"").focus();
    }

    function AddOrEditDoctor() {

        if (!$(""#DoctorForm"").data(""unobtrusiveValidation"").validate()) {
            return false;
        }

        var Name = $(""#Name"").val();
        var FatherName = $(""#FatherName"").val();
